//Variables y constantes(nunca cambian)
//Ahora let es para variables

const nombre = 'Bastian';

const apellido = 'Estrada Wevar'

let valorDado = 7;
valorDado = 6;

console.log(nombre, apellido, valorDado);

if (true) {

    let valorDado = 1;

    console.log(valorDado);
}

console.log(valorDado);
